import React from "react";

const PopUp = () => {
  return (
    <div className="flex justify-center items-center z-100 w-screen h-screen">
      <div className="lg:w-2/3 w-full h-screen border-2 flex">
        <div className="w-1/2 bg-primary"></div>
        <div className="w-1/2 p-6 ">
          <p>Name</p>
          <input className="bg-gray-300 w-full rounded-sm h-6"></input>
        </div>
      </div>
    </div>
  );
};

export default PopUp;
